import Mock from 'mockjs'
const Random = Mock.Random;

//  // 获取检验单列表
//  GetCheckReportService: {url: '/CheckReportService/GetCheckReportService', method: 'post'},
//  // 获取批次列表
//  GetBatchList: {url: '/CheckReportService/GetBatchList', method: 'post'},
//  // 检验单新增&编辑
//  SaveCheckReportService: {url: '/CheckReportService/SaveCheckReportService', method: 'post'},
//  // 检验单删除
//  delCheckReportService: {url: '/CheckReportService/delCheckReportService', method: 'post'},
// 获取单个检验单信息
// CheckReportService: {url: '/CheckReportService/GetCheckReportServiceById', method: 'post'},

var GetAll = [];
for (let i = 0; i < 5; i++) {
    let obj = {};
    obj.id = Random.integer(3);
    obj.productName = Random.cword(10);
    obj.productCode = Random.string(16);
    obj.creationTime = Random.datetime();
    if (i == 1 || i == 4) {
        obj.creationTime = null;
    }
    obj.batchNo = Random.string('upper', 3) + Random.integer(5);
    GetAll.push(obj);
}

var GetBatchList = [
    {
        "batchId": "e3af1edf9b5b474f8ad59fedfde0149b",
        "batchNo": "e3af1edf9b5b474f8ad59fedfde0149b",
        "productName": '产品名称1'
    },
    {
        "batchId": "e3af1edf9b5b474f8ad59fedfde0149c",
        "batchNo": "e3af1edf9b5b474f8ad59fedfde0149c",
        "productName": '产品名称2'
    },
    {
        "batchId": "e3af1edf9b5b474f8ad59fedfde0149d",
        "batchNo": "e3af1edf9b5b474f8ad59fedfde0149d",
        "productName": '产品名称3'
    }
];

var GetCheckReportServiceById = {
    "id": '1324325',
    // "batchNo": "e3af1edf9b5b474f8ad59fedfde0149b",
    "batchNo": "e3af1edf9b5b474f8ad59fedfde0149b",
    "CheckReportServiceImg": "data:image/png;base64,",
    "billOfEntryImg": "data:image/png;base64,",
    "taxListImg": "data:image/png;base64,"
}

//获取检验单列表
Mock.mock('/CheckReportService/GetAll', 'post', (options) => {
    console.log(JSON.parse(options.body));
    return { "result": { "totalCount": Random.integer(1, 100), "items": GetAll }, "success": true, "error": null, "unAuthorizedRequest": false };
});

// 获取批次列表
Mock.mock('/CheckReportService/GetBatchList', 'post', (options) => {
    console.log(JSON.parse(options.body));
    return { "result": GetBatchList, "success": true, "error": null, "unAuthorizedRequest": false };
});

// 检验单新增&编辑
Mock.mock('/CheckReportService/Save', 'post', (options) => {
    console.log(JSON.parse(options.body));
    return { "success": true, "message": "" };
});

// 检验单删除
Mock.mock('/CheckReportService/Delete', 'post', (options) => {
    console.log(JSON.parse(options.body));
    return { "success": true, "message": "" };
});
// 获取单个检验单信息
Mock.mock('/CheckReportService/Get', 'post', (options) => {
    console.log(JSON.parse(options.body));
    return { "result": GetCheckReportServiceById, "success": true, "message": "" };
});
